INSERT INTO `documents` (`doc_id`,`help_context_id`,`author_id`,`doc_title`,`doc_body`,`keywords`,`created_date`,`catalog_id`) VALUES 
 (3,1,733,'Add a Location to Your Profile','<body>\r\n<span style=\"font-weight: bold;\">Add a location to your profile<br>\r\n<span style=\"font-weight: bold;\"></span></span>Please see the \'Edit\r\nProfile Overview\' help article to view the basics of browsing the Edit\r\nProfile page.<br>\r\n<br>\r\nWhile in the Edit Profile view click the \'My Locations\' link.&nbsp; To\r\nadd a new location click the \'Add Location\' link towards the bottom of\r\nthe page. Enter all the information on the location. You can specify\r\nwhether it is a billing and or mailing address as well by clicking the\r\nappropriate check boxes. If you want your friends to be able to see this\r\nlocation check the box next to \'Show in profile\' then click the \'Save Changes\' button. Your location will be viewable once you refresh your session. You can also edit any of your existing locations and click \'Save Changes\' when complete.<span\r\nstyle=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span><br>\r\n</span>\r\n</body>\r\n</html>','address location ','2008-01-15 12:47:06',1),
 (4,1,733,'Change Your Phone or Fax Number','<h3 class=\"style1\">Change your phone or fax number</h3>\r\n<p class=\"style1\">Please see the help article titled \'Edit Profile Overview.\'</p>','phone number change fax mobile cellular cel cell','2008-01-15 12:51:20',1),
 (5,1,733,'Associate a file to a project','<h3 class=\"style1\">Associate a file to a project</h3>\r\n<p class=\"style1\">By associating a file to a project, you can make a file accessible to any user associated with the project you select.</p>\r\n<p class=\"style1\">Select \'My Files\' (step 1). A new \'Browse Files\' window will appear.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/AssociateFileToProjectSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Use the dropdown menus to select the location in which your file is stored (step 2). Click on \'No associated projects\' next to the file you which to associate (step 3).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/AssociateFileToProjectSteps2_3.png\" alt=\"\" /></p>\r\n<p class=\"style1\">In the \'Associate File With Project\' box that appears, use the drop down menu to select the project to which you wish to associate your file (step 4). Type a description of your file for other users to see (step 5). If you want to make your file accessible to other users who are associated with the project, select the \'File is releasable\' option (step 6). Click \'Add Association\' (Step 7).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/AssociateFileToProjectSteps4_7.png\" alt=\"\" /></p>\r\n<p class=\"style1\">To view your project association click the refresh button (step 8). Click on \'1 associated projects\' (step 9).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/AssociateFileToProjectSteps8_9.png\" alt=\"\" /></p>\r\n<p class=\"style1\">The details of your project association will appear:</p>\r\n<p><img src=\"https://www.prefiniti.com/help/help_images/AssociateFileToProjectSteps10.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>','associate association project file image photo','2008-01-15 13:58:02',1),
 (6,1,733,'Change the description of a file or photo','<h3 class=\"style1\">Change the description of a file or photo</h3>\r\n<p class=\"style1\">The default description of your files is the file name. You can change the description. If the file is a photo the description will also appear beneath the photo in your \'My Pictures\' tab.</p>\r\n<p class=\"style1\">Click on \'My Files\' as shown in picture (step 1). A new \'Browse Files\' tab will open.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileNameSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>\r\n<p class=\"style1\">Use the \'Folder\' drop down menus to locate the file you want to edit (step 2). Change the text in the \'Description\' field to change the description of the file (step 3). Click the disk icon to save the new description (step 4).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileDescriptionSteps2_3.png\" alt=\"\" /></p>\r\n<p>&nbsp;</p>','change description file caption photo image','2008-01-15 14:11:37',1),
 (7,1,733,'Change the name of a file or photo','<h3 class=\"style1\">Change the name of a file or photo</h3>\r\n<p class=\"style1\">Click on \'My Files\' as shown in picture (step 1). A new \'Browse Files\' tab will open.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileNameSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Use the \'Folder\' drop down menus to locate the file you want to edit (step 2). Change the text in the \'Name\' field to change the name of the file (step 3). Click the disk icon to save the new file name (step 4).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileNameSteps2_3.png\" alt=\"\"/></p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileNameSteps2_3.png\" alt=\"\"/></p>\r\n<p>&nbsp;</p>','change file photo name image','2008-01-15 14:26:52',1),
 (8,1,733,'Change privacy settings','<h3 class=\"style1\">Change your privacy settings</h3>\r\n<p class=\"style1\">Please see the help article \'Edit Profile Overview\' for more information.</p>','change privacy settings search profile','2008-01-15 14:29:37',1),
 (9,1,733,'Check your email inbox','<h3 class=\"style1\">Check your email inbox</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p>\r\n<p class=\"style1\">To view your inbox just click the \'Mail\' icon in the Prefiniti toolbar. Then click the \'View messages that have been sent to me\' link. If you have new mail you can click the \'New Messages\' link in the\'Notification tool bar\' to instantly go to your inbox.</p>','check email inbox mail message messages emails view open','2008-01-15 14:32:32',1),
 (10,1,733,'Configure your account to send text messages','<h3 class=\"style1\">Configure your account for receiving text messages</h3>\r\n<p class=\"style1\">Click on \'Contact Information\'.</p><p class=\"style1\">Select \'Configure my Account for Text Messaging\'. You will receive a text message to your mobile phone within several minutes. Please do not click this button more than once. (If you do not recieve a text message please send an email to <a href=\"mailto:support@prefiniti.com\">text</a> with your username, moblile phone number, service provider, and a description of the problem you had. We will email you back when your account is configured.). Follow the instructions that will appear at the bottom of the screen.</p>','receive receiving send sending text message texting mobile phone cellular cell cel messaging settings configure','2008-01-15 14:34:47',1),
 (11,1,733,'Create a timesheet','<h3 class=\"style1\">Create a new timesheet</h3></p><p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p>\r\n<p class=\"style1\">Click the \'Work\' icon in the Prefiniti tool bar. Select \'Start a new timesheet\' under the \'Time Entry\' heading. A new \'New Timesheet\' tab will appear. Use the drop-down menus to select the date and project number. Enter the job description and start time in the empty fields. Click \'Create Timesheet\'.</p>\r\n<p class=\"style1\">A new \'Edit Timesheet\' tab will open.</p>\r\n<p class=\"style1\">Select a task code using the drop-down menu. Enter a description and number of hours worked using the empty fields. If travel was involved enter the odometer start and end readings in the empty fields. The total mileage will be calculated automatically in the \'Total Mileage\' field. Click \'Add Item\'. Continue to add items until you are finished with this timesheet</p>\r\nIf your timesheet is ready to be submitted click \'Sign Timesheet\'.</p>\r\n<br />\r\nReview your timesheet and sign by typing your intials in the empty field. Click \'Sign Timesheet\' to submit.</p>','create timesheet submit hours sign miles mileage odometer','2008-01-15 14:41:34',1),
 (12,1,733,'Delete a file or photo','<h3 class=\"style1\">Delete a file or photo</h3>\r\n<p class=\"style1\">Click on \'My Files\' as shown in picture (step 1). A new \'Browse Files\' tab will open.</p>\r\n<p class=\"style1\">&nbsp;</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ChangeFileNameSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Use the \'Folder\' drop down menus to locate the file you want to edit (step 2). Click on the file you wish to delete (step 3). Click \'Delete File\' (step 4).</p>\r\n<p class=\"style1\"></p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/DeleteFileSteps2_4.png\" alt=\"\"/></p>\r\n<p class=\"style1\">Select \'OK\' (step 5).</p>\r\n<p class=\"style1\"></p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/DeleteFileSteps5.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>','delete file photo erase','2008-01-15 17:18:30',1),
 (13,1,733,'Delete a photo','<h3 class=\"style1\">Delete a photo</h3>\r\n<p class=\"style1\">Click on \'Pictures\' as shown in picture (step 1). A new \'Photos\' tab will open.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/DeletePhotoSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click on the photo you wish to delete (step 2). Select \'Delete File\' (step 3).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/DeletePhotoSteps2_3.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click \'OK\' (step 4).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/DeletePhotoSteps4.png\" alt=\"\" /></p>','delete photo picture image erase','2008-01-15 17:20:59',1),
 (14,1,733,'Find people on the Prefiniti network','<body>\r\n<span style=\"font-weight: bold;\">Find people on the Prefiniti Network<br>\r\n</span>Follow these instructions to locate your friends who are\r\nPrefiniti users.<br>\r\n<br>\r\nFrom the \'Socialize\' menu click on the \'search for new friends\' under\r\nthe \'Connect\' heading. Next you can choose which criteria to search by\r\n(Name Contains, Last Name, or E-Mail Address). Then type the name or\r\nemail in the text box. Click search and if any matches are found you\r\nwill see the results displayed.<br>\r\n<span style=\"font-weight: bold;\"></span>\r\n</body>\r\n</html>','find friends friend people person user users network connect search','2008-01-15 17:31:24',1),
 (15,1,733,'Edit your notification settings','<h3 class=\"style1\">Edit your notification settings</h3>\r\n<p class=\"style1\">Prefiniti can notify you by email or text message to a mobile phone when certain events occur. Follow these instructions to edit these settings.</p>\r\n<p class=\"style1\">Please see the \'Edit Profile Overview\' for more detailed information</p><p class=\"style1\">You can select any number of notification types for an event. For example, if you want to recieve an email and a text message for a friend request select both for that event.</p>','Edit notification settings notifications email message text mobile cellular phone cell cel','2008-01-15 17:34:22',1),
 (16,1,733,'Receive text notifications to your mobile phone','<h3 class=\"style1\">Receive text notifications to your mobile phone</h3>\r\n<p class=\"style1\">Make sure you have configured your account for text messaging. For instructions see \'Configure your account for receiving text messaging.\'</p>\r\n<p class=\"style1\">Then adjust your notification settings to receive texts according to your personal preferences. For instructions see \'Edit your notification settings.\'</p>\r\n<p class=\"style1\">&nbsp;</p>','receive text notifications message messages texting notification mobile phone cellular cell cel','2008-01-15 17:38:52',1),
 (17,1,733,'Adjust Firefox settings for compatibility with Prefiniti','<h3 class=\"style1\">Adjust Firefox settings for compatibility with Prefiniti</h3>\r\n<p class=\"style1\">Prefiniti requires the use of Java. Click the link below to check if you already  have Java or to install Java for free.</p>\r\n<p align=\"left\" class=\"style1\">&nbsp; <a href=\"http://www.java.com/?cid=2436\"> <img src=\"http://java.com/im/get_powered_sm.jpg\" title=\"Java Get Powered\" alt=\"Java Get Powered\" style=\"margin: 8px;\" /></a></p>\r\n<p class=\"style1\">Open Firefox and select &lsquo;Tools&rsquo; (step 1) and select &lsquo;Options&rsquo;  (step 2).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/FFSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Make sure the &lsquo;Content&rsquo; tab is selected (step 3). Make sure the option &lsquo;Block pop-up windows&rsquo; is NOT selected. Select the boxes &lsquo;Load images automatically,&rsquo; &lsquo;Enable JavaScript,&rsquo; &lsquo;Enable Java&rsquo; (step 4).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images//FFSteps3_5.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click &lsquo;OK&rsquo; (step 5).</p>','adjust firefox settings prefiniti compatibility compatible ','2008-01-15 17:44:04',1),
 (18,1,733,'Adjust Internet Explorer settings for compatibility with Prefiniti','<h3 class=\"style1\">Adjust Internet Explorer settings for compatibility with Prefiniti</h3>\r\n<h3 class=\"style1\">Important notice to Internet Explorer users!</h3>\r\n<p class=\"style1\">While Prefiniti is compatible with Internet Explorer, your experience with Prefiniti will be enhanced by using Mozilla Firefox. We strongly recommend you install Firefox. For more information on Firefox or to install click here.</p>\r\n<p class=\"style1\"><a href=\"http://www.spreadfirefox.com/?q=affiliates&amp;id=0&amp;t=210\"><img border=\"0\" src=\"http://sfx-images.mozilla.org/affiliates/Buttons/firefox2/firefox-spread-btn-1b.png\" title=\"Firefox 2\" alt=\"Firefox 2\" /></a></p>\r\n<p class=\"style1\">Adjust your settings for Prefiniti compatibility in Internet  Explorer<br />\r\nBefore you begin, please make sure you have installed  Internet Explorer 7. Click here to <a href=\"http://www.microsoft.com/windows/downloads/ie/getitnow.mspx\">verify your version of Explorer</a> and <a href=\"http://www.microsoft.com/windows/downloads/ie/getitnow.mspx\">download IE7</a> if necessary.</p>\r\n<p class=\"style1\"><br />\r\nPrefiniti requires the use of Java. Click here to check if you already  have Java or to install Java for free.</p>\r\n<p class=\"style1\">&nbsp; <a href=\"http://www.java.com/?cid=2436\"> <img width=\"100\" height=\"45\" border=\"0\" src=\"http://java.com/im/get_powered_sm.jpg\" title=\"Java Get Powered\" alt=\"Java Get Powered\" style=\"margin: 8px;\" /></a></p>\r\n<h2 class=\"style1\">Part A: Enable JavaScript</h2>\r\n<p class=\"style1\"><br />\r\nIn Internet Explorer 7 click on the \'Tools\' button (step 1) located in the upper right part of the screen (next to the gear icon) and select \'Internet Options\' (step 2).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click on the \'Security\' tab (step 3) and then click on the  \'Custom Level...\' button (step 4).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps3_4.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Scroll down (step 5) until you can see options as shown on the picture. They are located near the bottom of the list. Set the option \'Active scripting\' to \'Enable\' (step 6). Then click on the \'OK\' button (step 7).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps5_7.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click \'Yes\' (step 8).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps8.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click \'OK\' (step 9). This concludes enabling JavaScript for  Microsoft Internet Explorer 7.</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps9.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>\r\n<h2 class=\"style1\">Part B: Enable Java</h2>\r\n<p class=\"style1\"><br />\r\nIn Internet Explorer 7 click on the \'Tools\' button (step 1) located in the upper right part of the screen (next to the gear icon) and select \'Internet Options\' (step 2).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7EnableJavaSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click on the &lsquo;Security&rsquo; tab (step 3). Scroll down (step 4) until you can see &lsquo;Java (Sun)&rsquo; as shown on the picture. Put a check in the box &lsquo;Use JRE (requires restart)&rsquo; (step 5). Then click on the \'OK\' button (step 6). Then you must close and restart Explorer.</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/EnableJavaSteps3_6.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>\r\n<h2 class=\"style1\">Part C: Check for new content every time a page is visited</h2>\r\n<p class=\"style1\"><br />\r\nIn Internet Explorer 7 click on the \'Tools\' button (step 1) located in the upper right part of the screen (next to the gear icon) and select \'Internet Options\' (step 2).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"file:///C:/Users/Carolyn/Documents/WebWare.CL/Images_Help_Files/IE7EnableJavaSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click on the &lsquo;General&rsquo; tab (step 3). Under &lsquo;Browsing history&rsquo;  click the &lsquo;Settings&rsquo; button (step 4).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7CheckNewContentSteps3_4.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Select the option &lsquo;Every time I visit the webpage&rsquo; (step 5).  Click &lsquo;OK&rsquo; (step 6).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"file:///C:/Users/Carolyn/Documents/WebWare.CL/Images_Help_Files/IE7CheckNewContentSteps5_6.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Click &lsquo;OK&rsquo; (step 7).</p>\r\n<p class=\"style1\"><br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/IE7CheckNewContentSteps7.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>','adjust change internet explorer settings compatibility prefiniti compatible','2008-01-15 17:51:26',1),
 (19,1,733,'Upload a personal file','<h3 class=\"style1\">Upload a personal file</h3>\r\n<p class=\"style1\">You can upload personal files to the \'Personal files\' location. These files will count toward your personal storage space. Files that relate to your business can be uploaded to the \'Site files\' location. These count toward your business account storage space, but not your personal storage space.</p>\r\n<p class=\"style1\">Click on \'Upload & Store\' in the \'Prefiniti tool bar\' then click the \'View my files\' link in the pop up menu. A new \'Browse Files\' tab will open.</p>\r\n<p class=\"style1\">Select \'Personal files\' from the drop down menu .</p><p class=\"style1\">Note: If you want to upload photos that will appear in your personal profile, select \'Profile photos\' and refer to instructions \'Upload profile photos.\'</p>\r\n<p class=\"style1\">Select \'Upload files\'. Search for and select the file you would like to upload. Click \'Start Upload\'. Close the \'Upload Status\' box by clicking on the \'X\'.</p>','upload personal file files add','2008-01-15 17:56:49',1),
 (20,1,733,'Upload a profile photo','<h3 class=\"style1\">Upload a profile photo</h3>\r\n<p class=\"style1\">Follow these instructions to upload photos that will appear in your profile.</p>\r\n<p class=\"style1\">Note: If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti. If you want to upload company photos or images such as logos, select \'Profile photos\' and refer to instructions \'Upload photo to Site Files.\'</p>\r\n<p class=\"style1\">Click on \'Socialize\' in the \'Prefiniti tool bar\'. Then click \'Add photos to my profile\'. A new \'Photos\' tab will open.</p>\r\n<p class=\"style1\">Select \'Upload Photo\'. Search for and select the photo you would like to upload. Click \'Start Upload\'. Close the \'Upload Status\' box by clicking on the \'X\' when the upload is complete.</p>\r\n<p class=\"style1\">Please note: Keep in mind that the smaller the file is in size the faster your photos will load for other to see.</p>','upload profile photo add image picture','2008-01-16 14:33:57',1),
 (21,1,733,'Upload a site file','<h3 class=\"style1\">Upload a site file</h3>\r\n<p class=\"style1\">Files that relate to your business can be uploaded to the \'Site files\' location. These count toward your business account storage space, but not your personal storage space. You can upload personal files to the \'Personal files\' location. These files will count toward your personal storage space.</p>\r\n<p class=\"style1\">Note: If you want to upload company photos or images such as logos, select \'Profile photos\' and refer to instructions \'Upload photo to Site Files.\'</p>\r\n<p class=\"style1\">Instructions to uploading a site file are identical to the instructions in the help article \'Upload a personal file\' with the exception that you choose site files in the drop down list instead of personal files.</p>','upload add site file business document company project associate association','2008-01-16 14:41:49',1),
 (22,1,733,'Upload photo to site files','<h3 class=\"style1\">Upload photo to site files</h3>\r\n<p class=\"style1\">Use the site files storage space to upload company-related photos and images such as logos.</p>\r\n<p class=\"style1\">Click on \'My Files\' as shown in picture (step 1). A new \'Browse Files\' tab will open.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/UploadPhotoSiteFilesSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Select \'Site files\' from the first drop down menu (step 2). Select \'Profile photos\' from the second drop down menu (step 3). Select \'Stage Files\' (step 4). Click the \'My Computer\' button (step 5).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/UploadPhotoSiteFilesSteps2_5.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Search for and select the image you would like to upload. Click \'Start Upload\' (Step 6). Close the \'Upload Status\' box by clicking on the \'X\' (step 7).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/UploadPhotoSiteFilesSteps6_7.png\" alt=\"\" /></p>','upload photo site files company business logo image','2008-01-16 14:45:08',1),
 (23,1,733,'View your comments','<h3 class=\"style1\">View your comments</h3>\r\n<p class=\"style1\">Comments are located in your profile. Please refer to \'View your profile\' for instructions.</p>','view comments see read profile ','2008-01-16 14:46:27',1),
 (24,1,733,'View your friends','<h3 class=\"style1\">View your friends</h3>\r\n<p class=\"style1\">Friends are located in your profile. Please refer to \'View your profile\' for instructions.</p>','view friends profile users','2008-01-16 14:49:12',1),
 (25,1,733,'View a file or photo','<body>\r\n<span style=\"font-weight: bold;\">View a file or photo</span><br>\r\nIf you haven\'t already please see the help article \'Prefiniti \'How To\'\r\nOverview\' for more information about navigating Prefiniti.<br>\r\n<br>\r\nFollow these instructions to view a file or photo<br>\r\nClick on \'Upload &amp; Store\' from the \'Prefiniti tool bar\'. Then click\r\nthe \'View my files\' link in the pop up menu. A new page will load. Use\r\nthe \'Folder\' drop down menus to locate the photo you wish to view.\r\nClick on the file name. Select \'View File\' located in the in the upper\r\nleft side of the page in the \'Browsing tool bar\' location. Your browser\r\nwill open a new window with the full-size image. Click the link to view\r\nthe image in it\'s original size and click the \'Download\' button to\r\nstart the download.<br>\r\n<br>\r\nNote: The download button will not always cause an image to download.\r\nIf you would like to save the image to your computer then you will need\r\nto \'right click\' over the image and select \'save image as\'. There are\r\nvarious ways of performing this type of download. Please refer to your\r\nvarious operating systems instructions for exact documentation.<span\r\nstyle=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span></span><span\r\nstyle=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span><br>\r\n</span>\r\n</body>\r\n</html>','view see open file photo image picture document','2008-01-18 12:45:58',1),
 (26,1,733,'View your profile','<h3 class=\"style1\">View your profile</h3>\r\n<p class=\"style1\">Use these instructions to view your profile as your friends see it, to view comments your friends have left you, or to view your friends.</p>\r\n<p class=\"style1\">Click on \'Socialize\' as shown in picture (step 1). Then click \'View Profile.\' (Step 2)</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ViewProfileSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Within this page you will see your background and interests, blog, friends list, comments, news feed, and more.</p>','view see open profile comments friends','2008-01-18 12:47:32',1),
 (27,1,733,'View Sent Mail','<h3 class=\"style1\">View sent mail</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p>\r\n<p class=\"style1\">To view your sent mail or outbox just click the \'Mail\' icon in the Prefiniti toolbar. Then click the \'View messages I have sent\' link. Click the message you want to view.</p>','view see open sent out box messages message email mail emails','2008-01-18 12:54:54',1),
 (28,1,733,'Write an email','<h3 class=\"style1\">Write an email</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p>\r\n<p class=\"style1\">To write an email just click the \'Mail\' icon in the Prefiniti toolbar. Then click the \'Write a new mail message\' link. Select the person you are going to send to from the drop down list. If you want a read reciept check the box. Type a subject in the \'Subject\' field. If you want to attach a file click the \'Choose File\' button and select it from the list. You can reference a project by selecting from the list as well. Type your message and click the \'Send Message\' button.</p>','send write compose email emails message messages mail','2008-01-18 12:58:29',1),
 (31,1,733,'Reply to a mail message','<h3 class=\"style1\">Reply to a mail message</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p>\r\n<p class=\"style1\">To reply to a mail message just click the \'Reply\' link above the users picture who sent you the message.</p>','reply respond answer email message ','2008-01-25 16:26:27',1),
 (32,1,733,'Logout of Prefiniti','<h3 class=\"style1\">Logout of Prefiniti</h3>\r\n<p><span style=\"font-family: Verdana,Arial,Helvetica,sans-serif;\">Please see the help article \'Prefiniti \'How To\' Overview\' for more information on signing out.</p>','sign out log off logout exit','2008-01-25 16:29:13',1),
 (33,1,733,'Show your address in your profile','<h3 class=\"style1\">Show your address in your profile</h3>\r\n<p class=\"style1\">Please see the help article \'Add a location to your profile\' for details.</p>','show address appear profile privacy setting','2008-01-25 16:32:16',1),
 (34,1,733,'Make your address private','<h3 class=\"style1\">Make your address private</h3>\r\n<p class=\"style1\">Follow these instructions to make your address private. Your address will not be viewable by any user. If you have not read the \'Edit Profile Overview\' please do so before continuing.</p>\r\n<p class=\"style1\"><p class=\"style1\">Click on \'My Locations\'.</p>\r\n<p class=\"style1\">Deselect the \'Show in profile\' checkbox to make your address private.</p>','address private privacy setting settings hidden','2008-01-25 16:34:54',1),
 (35,1,733,'Assign an address as a billing address','<h3 class=\"style1\">Assign an address as a billing address</h3>\r\n<p class=\"style1\">Please see the help article \'Add a location to my profile\' for more information.</p>','address location billing assign','2008-01-25 16:36:44',1),
 (36,1,733,'Assign an address as a mailing address','<h3 class=\"style1\">Assign an address as a mailing address</h3>\r\n<p class=\"style1\">Please see the help article \'Add a location to my profile\' for more information.</p>','assign use address location mailing ','2008-01-25 16:38:23',1),
 (37,1,733,'View projects associated to a file','<h3 class=\"style1\">View projects associated to a file</h3>\r\n<p class=\"style1\">By associating a file to a project, you can make a file accessible to any user associated with the project you select.</p>\r\n<p class=\"style1\">Select \'My Files\' (step 1). A new \'Browse Files\' window will appear.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images//AssociateFileToProjectSteps1.png\" alt=\"\" /></p>\r\n<p class=\"style1\">Use the dropdown menus to select the location in which your file is stored (step 2). Click on \'1 associated project\' (step 3). The details of the associated project will appear directly below (step 4).</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ViewAssociatedProjectsSteps2_4.png\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p class=\"style1\">&nbsp;</p>','view see associated projects file association associations','2008-01-25 16:41:13',1),
 (38,1,733,'Submit miles for reimbursement','<h3 class=\"style1\">Submit miles for reimbursement</h3>\r\n<p><span style=\"font-family: Verdana,Arial,Helvetica,sans-serif;\">This feature is part of the timesheet feature. For instructions see \'Create a new timesheet.\' </span></p>','miles mileage reimbursement reimburse','2008-01-25 16:42:05',1),
 (39,1,724,'Website Privacy Statement','<div><strong><span style=\"font-size: 14pt;\">PREFINITI, Inc Website Privacy Statement</span></strong></div>\r\n<div>&nbsp;</div>\r\n<div><strong>1. Acknowledgement and acceptance of terms</strong></div>\r\n<div>&nbsp;</div>\r\n<p>Prefiniti, Inc. is committed to protecting your privacy. This Privacy Statement sets forth our current privacy practices with regard to the information we collect when you or your computer interact with our website.&nbsp;&nbsp; By accessing www.prefiniti.com, you acknowledge and fully understand Prefiniti, Inc.&rsquo;s Privacy Statement and freely consent to the information collection and use practices described in this Website Privacy Statement.</p>\r\n<div>&nbsp;</div>\r\n<div><strong>2. Participating Merchant Policies</strong></div>\r\n<div>&nbsp;</div>\r\n<p>Related services and offerings with links from this website, including vendor sites, have their own privacy statements that can be viewed by clicking on the corresponding links within each respective website. Online merchants and others who participate in Prefiniti, Inc. services are encouraged to participate in industry privacy initiatives and to take a responsible attitude towards consumer privacy.&nbsp;However, since we do not have direct control over the policies or practices of participating merchants and other third parties, we are not responsible for the privacy practices or contents of those sites.&nbsp;We recommend and encourage that you always review the privacy policies of merchants and other third parties before you provide any personal information or complete any transaction with such parties.</p>\r\n<div><strong>3. <span>Information We Collect and How We Use It</span></strong></div>\r\n<p>Prefiniti, Inc. collects certain information from and about its users three ways: directly from our Web Server logs, the user, and with Cookies.</p>\r\n<p style=\"margin-left: 0.5in; text-indent: -0.25in;\"><strong><span>a.<span style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong><span><strong>Web Server Logs</strong>.</span></p>\r\n<p style=\"margin-left: 0.25in;\">When you visit our Website, we may track information to administer the site and analyze its usage. Examples of information we may track include:</p>\r\n<ul type=\"disc\">\r\n    <li>Your Internet protocol      address.</li>\r\n    <li>The kind of browser or      computer you use.</li>\r\n    <li>Number of links you click      within the site.</li>\r\n    <li>State or country from which      you accessed the site.</li>\r\n    <li>Date and time of your visit.</li>\r\n    <li>Name of your Internet service      provider.</li>\r\n    <li>Web page you linked to our      site from.</li>\r\n    <li>Pages you viewed on the site.</li>\r\n</ul>\r\n<div style=\"text-indent: 0.25in;\"><strong>b. Use of Cookies</strong></div>\r\n<div style=\"text-indent: 0.25in;\">&nbsp;</div>\r\n<p>Prefiniti, Inc. may use cookies to personalize or enhance your user experience.&nbsp;A cookie is a small text file that is placed on your hard disk by a Web page server.&nbsp;Cookies cannot be used to run programs or deliver viruses to your computer.&nbsp;Cookies are uniquely assigned to you, and can only be read by a Web Server in the domain that issued the cookie to you.&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<p>One of the primary purposes of cookies is to provide a convenience feature to save you time.&nbsp;For example, if you personalize a web page, or navigate within a site, a cookie helps the site to recall your specific information on subsequent visits.&nbsp;Hence, this simplifies the process of delivering relevant content and eases site navigation by providing and saving your preferences and login information as well as providing personalized functionality..&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<p>Prefiniti, Inc. reserves the right to share aggregated site statistics with partner companies, but does not allow other companies to place cookies on our website unless there is a temporary, overriding customer value (such as merging into www.prefiniti.com a site that relies on third-party cookies).</p>\r\n<div>&nbsp;</div>\r\n<p>You have the ability to accept or decline cookies.&nbsp;Most Web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies. If you reject cookies by changing your browser settings then be aware that this may disable some of the functionality on our Website.</p>\r\n<div>&nbsp;</div>\r\n<ol type=\"a\" start=\"3\" style=\"margin-top: 0in;\">\r\n    <li><strong>Personal Information Users</strong></li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p>Visitors to our website can register to purchase services.&nbsp;When you register, we will request some personal information such as name, address, email, telephone number or facsimile number, account number and other relevant information.&nbsp;If you are purchasing a service, we will request financial information.&nbsp;Any financial information we collect is used only to bill you for the services you purchased.&nbsp;If you purchase by credit card, this information may be forwarded to your credit card provider. For other types of registrations, we will ask for the relevant information. You may also be asked to disclose personal information to us so that we can provide assistance and information to you. For example, such data may be warranted in order to provide online technical support and troubleshooting.</p>\r\n<div>&nbsp;</div>\r\n<p>We will not disclose personally identifiable information we collect from you to third parties without your permission except to the extent necessary including:</p>\r\n<div>&nbsp;</div>\r\n<p style=\"margin-left: 0.5in; text-indent: -0.25in;\">To fulfill your service requests for services.</p>\r\n<p style=\"margin-left: 0.5in; text-indent: -0.25in;\">To protect ourselves from liability,</p>\r\n<p style=\"margin-left: 0.5in; text-indent: -0.25in;\">To respond to legal process or comply with law, or</p>\r\n<p style=\"margin-left: 0.5in; text-indent: -0.25in;\">In connection with a merger, acquisition, or liquidation of the company.</p>\r\n<div style=\"margin-left: 0.25in;\">&nbsp;</div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>4. Use of Web Beacons or GIF files</strong></div>\r\n<p>www.prefinit.com Web pages may contain electronic images known as Web beacons &ndash; sometimes also called single-pixel gifs &ndash; that allow Prefiniti, Inc. to count users who have visited those pages and to deliver co-branded services.&nbsp;Prefiniti, Inc. may include Web beacons in promotional e-mail messages or newsletters in order to determine whether messages have been opened and acted upon.</p>\r\n<div>&nbsp;</div>\r\n<p>Some of these Web beacons may be placed by third party service providers to help determine the effectiveness of our advertising campaigns or email communications.&nbsp;These Web beacons may be used by these service providers to place a persistent cookie on your computer.&nbsp;This allows the service provider to recognize your computer each time you visit certain pages or emails and compile anonymous information in relation to those page views, which in turn enables us and our service providers to learn which advertisements and emails bring you to our website and how you use the site.&nbsp;Prefiniti, Inc prohibits Web beacons from being used to collect or access your personal information.</p>\r\n<div>&nbsp;</div>\r\n<div><strong>5. Accessing Web Account Information</strong></div>\r\n<p>We will provide you with the means to ensure that personally identifiable information in your web account file is correct and current.&nbsp;You may review this information by contacting us by sending an email to our support attendant &ndash; accounts@prefiniti.com</p>\r\n<div>&nbsp;</div>\r\n<div><strong>6. Changes to this Statement</strong></div>\r\n<p>Prefiniti, Inc. has the discretion to occasionally update this privacy statement.&nbsp;When we do, we will also revise the &ldquo;updated&rdquo; date at the top of this Privacy page.&nbsp;We encourage you to periodically review this privacy statement to stay informed about how we are helping to protect the personal information we collect.&nbsp;Your continued use of the service constitutes your agreement to this privacy statement and any updates.</p>\r\n<div>&nbsp;</div>\r\n<div><strong>7. Contacting Us</strong></div>\r\n<p>If you have questions regarding our Privacy Statement, its implementation, failure to adhere to this Privacy Statement and/or our general practices, please contact us at contact@prefiniti.com or send your comments to:</p>\r\n<div>&nbsp;</div>\r\n<div>Prefiniti, Inc.</div>\r\n<div><strong>Attention:&nbsp;Privacy Statement Personnel</strong></div>\r\n<div>3265 Arrowhead Rd, Ste 200<br />\r\nLas Cruces,  NM 88011-4786</div>\r\n<p>Prefiniti, Inc. will use commercially reasonable efforts to promptly respond and resolve any problem or question.</p>\r\n<div>&nbsp;</div>','privacy policy rule rules policies','2008-01-29 16:30:05',1),
 (40,1,733,'Place an order','<body>\r\n<span style=\"font-weight: bold;\">Place an order<br>\r\n<span style=\"font-weight: bold;\"></span></span>Follow these\r\ninstructions to place an order on the Prefiniti Network.<br>\r\n<br>\r\nNote: You can only order from the current site you are signed in under.\r\nTo change the site please click on any of the \'Prefiniti tool bar\'\r\nicons and select the site from the drop down list at the top of the pop\r\nup window. Your page will reload into the new site. Once you are in the\r\nsite you wish to order from follow the steps below.<br>\r\n<br>\r\nclick on the \'Shop\' icon in the \'Prefiniti tool bar\' (Step 1). The\r\nclick the \'Place an order\' link under the \'Shop\' heading (Step 2). A\r\nnew page will load.&nbsp; Follow the instructions on the new page to\r\nfinish your order. Prefiniti will send you an order confirmation based\r\non your notification settings.&nbsp; The default notification when you\r\ncreated your account is email. You can, however, receive text messages\r\nand Prefiniti Mail messages to notify you of order status.<br>\r\n<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span><img\r\nalt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/placeorder.png\"\r\nstyle=\"width: 580px; height: 481px;\"><br>\r\n</span>\r\n</body>\r\n</html>','place submit order job project price estimate','2008-02-07 14:48:49',1),
 (41,1,733,'Locate a project','<h3 class=\"style1\">Locate a project</h3>\r\n<p>Click on \'Project Locator\' located just above your profile picture (step 1). A drop-down window will appear. When a search is performed Prefiniti only searches within the selected \'Search Field\'. For example, when you want to locate an address then select the \'Address\' search field and the text you input will only search projects by address. You cannot select multiple search fields. Select the desired \'Search Field\' (step 2) and the desired \'Criteria\' (step 3). The \'Criteria\' options specify if the projects will be searched by only letters or words contained within the specific field, or by letters or combinations of letters that begin a word.&nbsp; For example; If you use the \'Contains\' option and search addresses with the text \'med\' any address in the database with the letters \'med\' in the spelling will be returned (i.e. \'Alameda Street\', \'Medpark Drive\', \'Mediocre Lane\'). If you use the \'Begins With\' and type \'med\' the results will begin with \'med\' (i.e. \'Medpark Drive\' and \'Mediocre Lane\'). Enter your search string into the empty field (step 4). Click \'Search\' (step 5). Results will be displayed in a new \'Project Search\' tab.<br />\r\n<br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/LocateProjectSteps1_5.png\" alt=\"\" /><br />\r\n<br />\r\nClick the project number of the project that you want to view (step 6).<br />\r\n<br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/LocateProjectSteps6.png\" alt=\"\" /><br />\r\n<br />\r\nNote: Searches that are returned will display the fields that you search by. If you search by \'Address\' then the addresses will be shown on all the returned search results. If you search by \'Section\' only the section, township and range fields will be displayed within the returned search results, and so on.</p>','locate find search project order job','2008-02-07 17:02:51',1),
 (42,1,733,'View your open timesheets','<h3 class=\"style1\">View your open timesheets</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p><p class=\"style1\">There are several ways to access open timesheets. The first way is to click \'Timesheets need signing\' in the notification tool bar.</p>\r\n<p class=\"style1\">The second way is to click \'Work\' from the Prefinit tool bar then click \'My open timesheets\' underneath the \'Time Entry\' heading.</p>\r\n<p class=\"style1\">If the timesheet you are viewing is complete it is ready to be signed. For instructions on signing a timesheet follow the instructions in \'Sign Timesheet\'.</p>','View see find search timesheets timesheet unsigned open','2008-02-08 15:38:06',1),
 (43,1,733,'Reverse a timesheet','<h3 class=\"style1\">Reverse a timesheet</h3>\r\n<p class=\"style1\">When an employee submits a timesheet for approval, a notification appears in the \'Notification tool bar\'. Click on the notification, \'timesheets need approval\'. Click on \'[+]\' to see the full details of the timesheet.</p>\r\n<p class=\"style1\">If the timesheet is incomplete or requires corrections, you can send it back to the employee for revision. Click \'Reverse Timesheet\'.</p>','reverse timesheet correct correction revise revision ','2008-02-15 12:14:17',1),
 (44,1,733,'View your personal timeshets for the current week','<h3 class=\"style1\">View your personal timesheets for the current week</h3>\r\n<p class=\"style1\">If you haven\'t already please see the help article \'Prefiniti \'How To\' Overview\' for more information about navigating Prefiniti.</p><p class=\"style1\">Click on the \'Work\' icon in the Prefiniti tool bar. Then click \'This week\'s timesheets  \'. A new \'This Week\'s Timesheets\' tab will open which will display your timesheets for the current week.</p>','view personal timesheets week weekly','2008-02-15 12:31:34',1),
 (45,1,733,'Manage task codes','<h3 class=\"style1\">Manage task codes</h3>\r\n<p class=\"style1\">Task codes indicate to accounting the type of work being done by employees. Each task is directly associated with a cost. An employee selects from a list of task codes when entering timesheets. Prefiniti does not create task codes for a company, but provides the interface for a company to create its own. Make sure you are familiar with your company\'s task codes. Follow these instructions to create a new task code.</p>\r\n<p class=\"style1\">Roll over \'Time Entry\' in the upper grey toolbar (step 1). Click \'Manage Task Codes\' (step 2). A new \'Manage Task Codes\' tab will open.</p>\r\n<p class=\"style1\"><img src=\"https://www.prefiniti.com/help/help_images/ManageTaskCodesSteps1_2.png\" alt=\"\" /></p>\r\n<p class=\"style1\">&nbsp;</p>\r\n<p>If necessary, scroll down to the bottom of the task codes (step 3). In the \'Task Code\' field enter the number that will correspond to the new task code (step 4). In the \'Item\' field enter the name of the new task code (step 5). In the \'Description\' field type a short description of the new task code (step 6). In the \'Rate\' field enter the dollar amount associated with the task code (step 7). In the \'Charge Type\' drop down menu select the appropriate option (step 8). For example, entering \'45\' in the \'Rate\' field and selecting \'Hour\' in the \'Charge Type\' field would indicate a rate of $45 per hour associated with the new task code. Click \'Add Task Code\' to enter the new task code into the system (step 9).<br />\r\n<br />\r\n<img src=\"https://www.prefiniti.com/help/help_images/ManageTaskCodesSteps3_9.png\" alt=\"\" /></p>\r\n<p>&nbsp;</p>','manage task codes code create new ','2008-02-15 13:26:35',1),
 (46,1,724,'PWindow()','<h3>Overview:</h3>\r\n<p>Creates a new window object that can be loaded via the <strong><em>SessionObject</em>.Framework.CreateWindow()</strong> function</p>\r\n<h3>Syntax:</h3>\r\n<code>\r\n	<em>windowObject</em> = <strong>new</strong> PWindow(<em>Handle, Title, Rect, Icon, Style, MessageHandler, Color</em>);\r\n</code>\r\n<h3>Parameters:</h3>\r\n<blockquote>\r\n\r\n<h4>Handle</h4>\r\n<p><strong>Type:</strong> String</p>\r\n<p>The string handle by which the new window will be identified.</p>\r\n\r\n<h4>Title</h4>\r\n<p><strong>Type:</strong> String</p>\r\n<p>This string will be placed in the new window\'s title bar.</p>\r\n\r\n<h4>Rect</h4>\r\n<p><strong>Type:</strong> PRect() or PAutoRect()</p>\r\n<p>The dimensions of the window will be determined by the dimensions of this PRect() rectangle. If a PAutoRect() is used instead, the system will determine the placement of the window automatically.</p>\r\n\r\n<h4>Icon</h4>\r\n<p><strong>Type:</strong> PIcon()</p>\r\n<p>The icon displayed in the window\'s application box (if applicable) and in its Desktop Manager button.</p>\r\n\r\n<h4>Style</h4>\r\n<p><strong>Type:</strong> Numeric</p>\r\n<p>Bitmask determining the desired style of the window to be created. The value of this parameter may be built by combining the desired WS_<em>xxxxx</em> constants together with bitwise OR.<p>\r\n<p>The following style constants are available:</p>\r\n	<table>\r\n    	<tr>\r\n        	<td><strong>Style Constant</strong></td>\r\n            <td><strong>Effect (when bit turned on)</strong></td>\r\n		</tr>\r\n        <tr>            \r\n    		<td>WS_ALLOWCLOSE</td>\r\n            <td>Window can be closed</td>\r\n        </tr>\r\n        <tr>\r\n        	<td>WS_ALLOWMINIMIZE</td>\r\n            <td>Window can be minimized</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_ALLOWMAXIMIZE</td>\r\n            <td>Window can be maximized</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_ALLOWRESIZE</td>\r\n            <td>Window can be resized</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_SHOWAPPMENU</td>\r\n            <td>Shows application menu in window title bar</td>\r\n		</tr>            \r\n       	<tr>\r\n        	<td>WS_ENABLEPDM</td>\r\n            <td>Allows the window to be managed by the PDM dock</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_ROOT</td>\r\n            <td>Window is a root window. Only the Prefiniti Window Manager can use this style.</td>		\r\n        </tr>\r\n        <tr>\r\n        	<td>WS_MODAL</td>\r\n            <td>Window cannot lose focus until closed</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_DEFAULT</td>\r\n            <td>Shorthand for WS_ALLOWCLOSE | WS_ALLOWMINIMIZE | WS_ALLOWMAXIMIZE | WS_ALLOWRESIZE | WS_SHOWAPPMENU | WS_ENABLEPDM</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_DIALOG</td>\r\n            <td>Shorthand for WS_ALLOWCLOSE | WS_ALLOWMINIMIZE | WS_ENABLEPDM | WS_SHOWAPPMENU</td>\r\n		</tr>\r\n        <tr>\r\n        	<td>WS_TOOLWINDOW</td>\r\n            <td>Shorthand for WS_SHOWAPPMENU</td>\r\n		</tr>\r\n	</table>    \r\n<h4>MessageHandler</h4>\r\n<p><strong>Type:</strong> Callback Function</p>\r\n<p>A reference to the developer-supplied function responsible for handling system messages sent to the window. If <em>MessageHandler</em> is <strong>null</strong>, the framework will perform only default processing of messages on the window\'s behalf.</p>\r\n<p>See the Framework Programmer\'s Guide document titled \"Window Message Handling\" for more information about custom message handlers.</p>\r\n\r\n<h4>Color</h4>\r\n<p><strong>Type:</strong> PColor()</p>\r\n<p>Sets the color of the window.</p>\r\n\r\n</blockquote>    ','PWindow','2008-05-29 03:45:48',3),
