 (93,1,725,'Scheduling Crews and Departments','<p>Once a crew or department is created (see &quot;<em style=\"\">Creating Crews and Departments</em>&quot; under Search Help) the manager of that crew may schedule his or her crew.<o:p></o:p></p>\r\n<p><strong style=\"\">1</strong>. From the project view begin this process by clicking &quot;Dispatch Crew.&quot;&nbsp; A window will pop up and show a list with all the available crews that;<o:p></o:p></p>\r\n<p>&nbsp;&nbsp;&nbsp; <strong style=\"\">A</strong>. you are a manager of<o:p></o:p></p>\r\n<p>&nbsp;&nbsp;&nbsp; <strong style=\"\">B</strong>. you are set as a &quot;Global Scheduler&quot; which will give you the ability to schedule any crew/department<o:p></o:p></p>\r\n<p><strong style=\"\">2</strong>. Click on a crew whose schedule you wish to see and you will see the daily schedule appear below.&nbsp; After viewing the schedule for available times you can go to the next step.<o:p></o:p></p>\r\n<p><strong style=\"\">3</strong>. Select the start time, end time and the date and click the &quot;Save Event&quot; button.&nbsp; If the event was saved successfully then you will see red text saying that the &quot;Event Created.&quot;&nbsp; All crew members are instantly notified based on their notification settings. (See &quot;<em style=\"\">Edit your notification settings</em>&quot; under Search Help.)<o:p></o:p></p>\r\n<p><strong style=\"\">4</strong>. Close the window.<o:p></o:p></p>','permissions permission site permissions scheduling scheduler site accounts global department departments','2008-06-02 23:06:31',1),
 (95,1,725,'Creating Crews and Departments','<p class=\"MsoNormal\">You can create departments, also called crews, and their individual managers by following these steps:</p>\r\n<ol type=\"1\" start=\"1\" style=\"margin-top: 0in;\">\r\n    <li style=\"\" class=\"MsoNormal\">Go to the      &ldquo;Tools&rdquo; menu and click on &ldquo;Site Maintenance.&rdquo;</li>\r\n    <li style=\"\" class=\"MsoNormal\">Click      on &ldquo;Departments&rdquo;</li>\r\n    <li style=\"\" class=\"MsoNormal\">Click      the &ldquo;Add Department Link.&rdquo;<span style=\"\">&nbsp; </span>A window      will appear.<span style=\"\">&nbsp; </span>Give the department a      name and click the &ldquo;Add Department&rdquo; button.<span style=\"\">&nbsp; </span>You can add as many departments as you      like by re-filling the department name box and continuing to click the &ldquo;Add      Department&rdquo; button.<span style=\"\">&nbsp; </span>When you are      finished close the window.<span style=\"\">&nbsp; </span><em style=\"\">Please think about your company      structure and consider that if you are a &ldquo;Global Scheduler&rdquo; you do not      need to be a part of a department to schedule its members.<span style=\"\">&nbsp; </span>When departments are created you will      have to set their &ldquo;Business Events&rdquo; under &ldquo;Site Maintenance.&rdquo;<span style=\"\">&nbsp; </span>If a single person is a member of more      than one department he or she will receive as many notifications on      business events as the number of departments he or she is a member of      using the identical &ldquo;Business Event.&rdquo;</em></li>\r\n    <li style=\"\" class=\"MsoNormal\">Click      on a department name and it will expand and you can click the &ldquo;Add Member&rdquo;      link.<span style=\"\">&nbsp; </span>A window will appear showing      you a list of all your company&rsquo;s employees.<span style=\"\">&nbsp; </span>Click the &ldquo;Choose&rdquo; button next to the      employee you want to add to the department.<span style=\"\">&nbsp; </span>When finished choosing the employees      that you want close the window.</li>\r\n    <li style=\"\" class=\"MsoNormal\">Click      on the department name once again and click the &ldquo;Make Manager&rdquo; link next      to the green arrow beside the employee of the department you want to set      as the manager.</li>\r\n    <li style=\"\" class=\"MsoNormal\">You      can remove members by clicking remove member.</li>\r\n    <li style=\"\" class=\"MsoNormal\">Go to &ldquo;Business      Events&rdquo; and add the appropriate events by selecting the &ldquo;Check Box&rdquo; next      to the department name under each business event type.</li>\r\n</ol>','departments department create department crew crews','2008-06-02 23:25:14',1),
 (96,1,725,'Site Permissions','<p class=\"MsoNormal\">Please follow the steps below to add or remove permissions from site accounts.<span style=\"\">&nbsp; </span>Site accounts are profiles associated (do business with your company) with your company.<span style=\"\">&nbsp; </span>By default any new member of your site will be set as a customer.<span style=\"\">&nbsp; </span>To add new employees please email their name and email address (if they do not have one please specify and we will give them a <em style=\"\">myprefiniti.com </em>email address.) to <a href=\"mailto:accounts@prefiniti.com\">accounts@prefiniti.com</a>.<span style=\"\">&nbsp; </span>They will be added by the following business day.</p>\r\n<ol type=\"1\" start=\"1\" style=\"margin-top: 0in;\">\r\n    <li style=\"\" class=\"MsoNormal\">Go to      the &ldquo;Accounts&rdquo; menu and click on &ldquo;Site Accounts.&rdquo;<span style=\"\">&nbsp; </span>You will see a list appear showing the      member&rsquo;s name, account type and &ldquo;Permissions&rdquo; link.</li>\r\n    <li style=\"\" class=\"MsoNormal\">Click      the &ldquo;Permissions&rdquo; link of the name of the user.</li>\r\n    <li style=\"\" class=\"MsoNormal\">Select      or de-select the desired permissions.<span style=\"\">&nbsp;      </span><em style=\"\">Remember that all users will      need the &ldquo;login&rdquo; permission to view to the site.<span style=\"\">&nbsp; </span>Permissions below in bold are      recommended for all users and permissions in italics are recommended for      employees.<span style=\"\">&nbsp; </span>Permissions below in      bold and italic are recommended for administrative employees.<span style=\"\">&nbsp; </span>However, any user can have any      combination of permissions.<span style=\"\">&nbsp; </span>All      permissions with * are not needed any longer and do not matter.</em></li>\r\n</ol>\r\n<p class=\"MsoNormal\"><em style=\"\">Create Member </em>&ndash; Allows a user to add accounts to the site</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Delete Member</em> &ndash; Allows a user to delete site accounts</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Edit Member</em> &ndash;Allows a user to edit site accounts</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Login</strong> &ndash; Allows members to log in.</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View Memberships</strong> &ndash; Allows users to view members of the site</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Associate File to GIS Map</em> &ndash; Allows users to</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Browse Files &ndash; </strong>Allows users to browse their personal files<strong style=\"\"><o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Delete File &ndash; </strong>Allows users to delete their personal files</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Delete Staged Files</em></strong> &ndash; Allows users to delete files staged files to your company directory.</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Download File &ndash; </strong>Allows users to download files<strong style=\"\"><o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Stage Files to Site &ndash; Allows <o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Upload File</strong> &ndash; Allows a user to upload files</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View Staged Files</strong> &ndash; Allows users to view files within projects</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Create Subdivision</em></strong> &ndash; Allows users to create subdivision names</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Edit Subdivision</em></strong> &ndash; Allows users to edit subdivision names</p>\r\n<p class=\"MsoNormal\"><em style=\"\">View Subdivision</em> &ndash; Allows users to view subdivisions</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View Mail Message</strong> &ndash; Allows a user to view mail messages</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Write Mail Message</strong> &ndash; Allows users to write mail messages</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Create News Article</em></strong> &ndash; Allows users to create site news articles that all site users see.</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Dispatch Crew </em>&ndash; Allows a user to dispatch crews or departments he or she manages</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Global Scheduler</em></strong> &ndash; Allows a user to schedule all crews and departments</p>\r\n<p class=\"MsoNormal\">Manage Crew*</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View Schedule</strong> &ndash; Allows a user to see his or her schedule and calendar.</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Approve Timesheet </em></strong>&ndash; Allows an employee to approve other employee&rsquo;s signed timesheets</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Create Timesheet</em> &ndash; Allows a user to create a timesheet</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Create Task Codes</em></strong> &ndash; Allows an employee to create company task codes that are used in timesheets to specify a certain task and a rate or charge associated with that task.</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Delete Timesheet</em> &ndash; Allows an employee to delete a timesheet<em style=\"\"><o:p></o:p></em></p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Delete Task Codes</em></strong> &ndash; Allows an employee to delete a task code</p>\r\n<p class=\"MsoNormal\"><em style=\"\">Edit Timesheet</em> &ndash; Allows an employee to edit a timesheet before it is signed</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Edit Task Codes</em></strong> &ndash; Allows an employee to edit existing task codes</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Reverse Timesheet</em></strong> &ndash; Allows an employee to reverse a signed timesheet back to the employee that signed it for corrections or questions</p>\r\n<p class=\"MsoNormal\"><em style=\"\">View Timesheet</em> &ndash; allows a user to view a timesheet</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Timesheet Administrator</em></strong> &ndash; Allows an employee or owner to edit, delete and manage all employees&rsquo; timesheets for the entire company.</p>\r\n<p class=\"MsoNormal\"><em style=\"\">View Task Codes</em> &ndash; Allows a user to view the list of task codes</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Assign Drafter</em></strong> &ndash; Allows an employee to assign the drafter position in the Project View</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Assign Surveyor</em></strong> &ndash; Allows an employee to assign the surveyor position in the Project View</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Assign Project Manager</em></strong> &ndash; Allows an employee to assign a project manager in the Project View</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Create Project</strong> &ndash; Allows a user to create or request a project and or place an order</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Delete Project</em></strong> &ndash; Allows an employee to delete an existing project</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Edit Project</em></strong> &ndash; Allows an employee to edit information and field within the project view</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Manage Delinquent Accounts</em></strong> &ndash; Allows an employee to send email reminders to accounts that are past due</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Process Order</em></strong> &ndash; Allows an employee to process new orders and save them as projects</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Process RFP</em></strong> &ndash; Allows users to place bids that are requested by customers</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Search Projects</strong> &ndash; Allows users to search their projects</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View Project</strong> &ndash; Allows users to view projects</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">View RFP</strong> &ndash; Allows users to view projects</p>\r\n<p class=\"MsoNormal\"><strong style=\"\"><em style=\"\">Site Maintainer</em></strong> &ndash; Allows an employee to manage your company site.<span style=\"\">&nbsp; </span>Make sure this is someone who understands what he or she is doing at all times.<span style=\"\">&nbsp; </span><em style=\"\">This permission has the most power over all other permissions and can change other users permissions associated with your site.<o:p></o:p></em></p>','permissions site accounts permission user','2008-06-03 00:07:56',1),
 (97,1,725,'Setting Your Time Zone','<p>By default the Prefiniti Network is set to run in the U.S. Mountain Time Zone.&nbsp; If you reside in a different time zone please make sure to configure your settings with the following procedure:</p>\r\n<p>Please see the help article \'Edit Profile Overview\' for instructions.</p>\r\n<p>Note: At this time Prefiniti is working on providing support for areas outside of Daylight Savings and for persons using Military Time.&nbsp; If you reside in <em>Arizona you will need to set your time zone to Pacific Time during the Daylight Savings duration beginning on the second Sunday of March at 2:00 AM until the first Sunday in November at 2:00 AM</em>.</p>','time zone central mountain pacific arizona daylight savings','2008-06-05 10:52:28',1);
