 (98,1,725,'Prefiniti \'How To\' overview','<body>\r\n<span style=\"font-weight: bold;\">Prefiniti \'How To\' Overview<br>\r\n</span>In this article you will be shown how to use the basic menu and\r\nbrowsing structure of Prefiniti. Please refer to this article when\r\nbasic navigation steps are not graphically displayed in other help\r\narticles.&nbsp; This article covers:<br>\r\n<ul>\r\n<li>Using the Prefiniti tool bar</li>\r\n<li>Using the Browsing tool bar</li>\r\n<li>Using the Favorites tool bar</li>\r\n<li>Using the Notification tool bar</li>\r\n<li>Tabbed Browsing<br>\r\n</li>\r\n<li>Today at a Glance<br>\r\n</li>\r\n<li>Signing out of Prefiniti</li>\r\n<li>Birth dates</li>\r\n</ul>\r\n<span style=\"font-weight: bold;\">Prefiniti Tool Bar<br>\r\n</span>The Prefiniti tool bar is the menu located at the top of the\r\npage that contains the large icons with descriptions along side each\r\nicon.&nbsp; When you click one of these icons (Step 1) a menu box will\r\nbe displayed below the tool bar. Click one of the menu items to have\r\nits contents displayed in the main window (Step 2).<br>\r\n<img alt=\"Figure 1\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/Prefinititoolbar1_2.png\"\r\nstyle=\"width: 621px; height: 447px;\"><br>\r\nIn the picture below you can see the end result. Explore and have fun!<br>\r\n<img alt=\"figure 2\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/Prefinititoolbar3.png\"\r\nstyle=\"width: 714px; height: 374px;\"><br>\r\n&nbsp;<br>\r\n<span style=\"font-weight: bold;\">Using the Browsing tool bar<br>\r\n</span>Located in the upper left corner of the page you will see a row\r\nof small icons.&nbsp; Click on any one of these icons to launch its\r\nfeature. The first 4 icons exist on all users pages. Icons after these\r\nare based on a users permissions to view certain applications or pages.\r\nWhile using Prefiniti you do not need to use your browsers back button,\r\nas it will cause a full page reload. To move back to a previous page in\r\nPrefiniti use the back (1) or forward (2) arrows within this tool bar.\r\nIf you would like to check for new information within the page you are\r\nviewing just click the refresh arrows (3). And to add favorites click\r\nthe star (4).<br>\r\n<br>\r\n<img alt=\"browsingbar\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/browsingbar.png\"\r\nstyle=\"width: 509px; height: 434px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Using the Favorites tool bar</span><br>\r\nTo create<span style=\"font-weight: bold;\"> </span>a favorite first go\r\nto a page you would like to add. I\'m going to add my friend John\'s\r\nprofile to my Favorites.&nbsp; Click the star icon in the Browsing tool\r\nbar (Step 1).&nbsp; Give a name to your Favorite (Step 2). Select if\r\nyou would like to add this to your \'favorites bar\' (step 3).&nbsp; Then\r\nclick the \'save\' button (step 4).<br>\r\n<img alt=\"add to favorites\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/addfavorites1.png\"\r\nstyle=\"width: 714px; height: 374px;\"><br>\r\nYou can access your saved favorites from your \'favorites bar\' or from\r\nthe \'Favorites\' icon located in the Prefiniti tool bar (See picture\r\nbelow).&nbsp; You can add and remove saved favorites to your \'favorites\r\nbar\' from the \'Favorites\' menu.&nbsp; You can also delete saved\r\nfavorites from this menu as well.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/addfavorites2.png\"\r\nstyle=\"width: 666px; height: 394px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Using the Notification tool bar<br>\r\n</span>The Notification tool bar is located just below the \'favorites\r\nbar.\' Whenever Prefiniti sends you a notification they will appear in\r\nthis location. Right now Prefiniti is telling me I have 2 new\r\nmessages.&nbsp; To view these I just click the notification.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/notifications1.png\"\r\nstyle=\"width: 739px; height: 383px;\"><br>\r\nThe results are now displayed (Picture below). The notification will\r\ndisappear when you view the item. Prefiniti Notifications are real\r\ntime.&nbsp; This means if a friend leaves you a comment you will see a\r\nnotification pop up in the Notification tool bar. Notifications give\r\nyou quick access to new information at the click of a mouse.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/notifications2.png\"\r\nstyle=\"width: 825px; height: 448px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Tabbed Browsing</span><br>\r\nWhen you are browsing within the Prefiniti Network you will notice that\r\nnew tabs are created at the top of the page when you visit new pages\r\n(picture below). You can click these tabs to jump to and from pages you\r\nhave already opened. You can click the \"x\" button on the right side of\r\nthe tab to close it. Tabs that are lighter in color are the current tab\r\nyou are viewing. Try it out and see how quick it makes browsing\r\nPrefiniti.&nbsp; I like to keep about 4 or 5 tabs open at a time.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/tabbedviewing.png\"\r\nstyle=\"width: 615px; height: 376px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Today at a Glance<br>\r\n<span style=\"font-weight: bold;\"></span></span>Today at a Glance gives\r\nyou one click access to any events or tasks that you have scheduled\r\nthrough the the Prefiniti Calendar.&nbsp; Today at a Glance is only\r\nviewable through the \'Prefiniti Home\' view, which is the first page you\r\nsee when you log in. In the picture below I have clicked the link\r\n\'Movies at John\'s\' and my event details are displayed.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/todayataglance.png\"\r\nstyle=\"width: 648px; height: 376px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Signing out of Prefiniti<br>\r\n</span>You can sign out of Prefiniti from any of the Prefiniti Menu\r\nitems.&nbsp; For example I am going to click on \'Socialize\' (Step 1)\r\nand then click the \'sign out\' and I\'m done.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/signingout.png\"\r\nstyle=\"width: 648px; height: 376px;\"><br>\r\n<br>\r\n<span style=\"font-weight: bold;\">Birth Dates<br>\r\n</span>When you enter your age on Prefiniti please remember that it is\r\nvery important. Prefiniti tracks users profiles to help protect our\r\nyounger users from being approached by online predators.&nbsp; When you\r\nare an adult visiting a minors page you will be alerted. We want\r\nPrefiniti to be a safe and user friendly environment. In the future we\r\nwill use methods of confirming a users actual age to make this feature\r\nmore accurate. Thank you and have fun while using Prefiniti.<span\r\nstyle=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span><br>\r\n</span><span style=\"font-weight: bold;\"></span><span =\"\"></span>\r\n</body>\r\n</html>','prefiniti using how to instructions basic menu tool bar sign out log out today glance favorite favorites birth date','2008-08-02 16:21:30',1),
 (99,1,725,'Edit Profile Overview','<body>\r\n<span style=\"font-weight: bold;\">Edit Profile Overview<br>\r\n<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"></span></span></span>In\r\nthis article I will show you how to use the \'Edit Profile\' page within\r\nPrefiniti. Please see the <span style=\"font-weight: bold;\">Prefiniti\r\n\'How To\' Overview </span>if you haven\'t done so already, before you\r\ncontinue.<br>\r\n<br>\r\nWhile in \'Edit Profile\' you can change information about yourself like,\r\nbirthday, locations, and phone numbers.&nbsp; You can configure your\r\naccount\'s notification settings and tell it to send text message\r\nnotifications to your mobile phone.&nbsp; To go to the \'Edit Profile\'\r\npage click on the the \'Socialize\' icon (Step 1) in the Prefiniti tool\r\nbar and click \'Change my profile info\r\n\' (Step 2) or click on the \'Customize\' icon in the Prefiniti tool bar\r\nand click any of the links you want to access.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/editprofile1.png\"\r\nstyle=\"width: 648px; height: 376px;\"><br>\r\n<br>\r\nThen select a category to display it in the area to the right. (Below)<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/editprofile2.png\"\r\nstyle=\"width: 648px; height: 376px;\"><br>\r\nWhen you make changes in any of these categories make sure to click the\r\n\'save\' button when present. Some categories, like \'notifications\' do\r\nnot have a save button and are updated upon selecting the box next to\r\nthe notification.<br>\r\n<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"><span\r\nstyle=\"font-weight: bold;\"></span></span><br>\r\n</span>\r\n</body>\r\n</html>','edit profile contact info address time zone notifications privacy storage location locations interests background memberships memberships','2008-08-02 16:21:30',1),
 (100,1,725,'Toolbar Settings','<body>\r\n<span style=\"font-weight: bold;\">Toolbar Settings<br>\r\n</span>In this article I will show you how customize the view of your\r\nPrefiniti tool bar.<br>\r\n<br>\r\nClick the \'Toolbar Settings\' link in the upper right corner of the page\r\n(Step 1). Choose whether or not you want the text displayed next to the\r\nicons or not by selecting the appropriate radio button next to the\r\ndescription (Step 2). I\'m going to set mine to display the text. Next I\r\ncan choose which icons I want displayed by checking or un-checking the\r\nboxes next to the appropriate icons (Step 3). I\'m going to hide the\r\n\'Work\' icon, because I don\'t use Prefiniti for work. Anytime you change\r\na setting it is automatically updated in real time, so you don\'t have\r\nto check any save buttons.&nbsp; Just close the window when you\'re\r\nfinished.<br>\r\n<img alt=\"\"\r\nsrc=\"http://www.prefiniti.com/help/help_images/new/toolbarsettings.png\"\r\nstyle=\"width: 746px; height: 555px;\"><br>\r\n</body>\r\n</html>','toolbar settings tool bar edit buttons','2008-08-02 16:21:30',1);
