INSERT INTO `home_quotes` (`id`,`what_the_homie_said`,`the_homie_who_said_it`) VALUES 
 (1,'Because I used Prefiniti... I can vouch for its effectiveness. All of the \r\nimportant information--including progress, due date, costs --is current and available...','Joseph H. Bell, LS'),
 (2,'Since the client can find all the current information on a job by browsing on his or her computer, there are fewer phone calls and fewer e-mails.','Joseph H. Bell, LS'),
 (3,'The Prefiniti Network is great when ordering surveys, as it can be done 24/7, and the finished product comes right to\r\nyour computer.','Clay Schlothauer, Escrow Officer, Southwestern Abstract and Title Co.'),
 (4,'I love working with the time management program- I keep a better connection with my employees and the time they are working.','Dr. Tim Herndon, President, Pediatrician\r\n\r\nChildren\'s Wellness Center'),
 (5,'\r\nBeing online is a real plus. I look forward to more online Prefiniti services.','Dr. Tim Herndon, President, Pediatrician\r\n\r\nChildren\'s Wellness Center');
